import React from 'react'
import styled from 'styled-components'
import user from '../app/user'

export default function SocialNetworks() {

  return (
    <SocialNetworksContainer>
      <div>
        <img src='https://www.flaticon.com/svg/static/icons/svg/145/145802.svg' onClick={() => {
          window.open(user.facebook, '_blank').focus()
        }} style={{ marginRight: 12 }} />
        <img src='https://www.flaticon.com/svg/static/icons/svg/145/145807.svg' onClick={() => {
          window.open(user.likedin, '_blank').focus()
        }} style={{ marginLeft: 12 }} />
      </div>
    </SocialNetworksContainer>
  )
}

const SocialNetworksContainer = styled.div`
  display: flex;
  flex-direction: row-reverse;
  justify-content: center;
  align-items: center;
  img {
    cursor: pointer;
    height: 32px;
    width: 32px;
  }
`
